        "results": {
            "type": "array",
            "items": {
                "type": "object",
                "properties": {
                    "clientId": {
                        "type": "integer"
                    },
                    "providerIds": {
                        "type": "array",
                        "items": {
                            "type": "integer"
                        }
                    },
                    "isManualSettings": {
                        "type": "boolean"
                    },
                    "lastModifiedDateTime": {
                        "type": "string"
                    }
                }
            }
        },
        "result": {
            "type": "string"
        },
        "failed": {
            "type": "boolean"
        },
        "cachedTime": {
            "type": "integer"
        }
    }
}

 ```

