    "type": "object",
    "properties": {
        "preferredProviders": {
            "type": "array",
            "items": {}
        },
        "result": {
            "type": "string"
        },
        "failed": {
            "type": "boolean"
        },
        "cachedTime": {
            "type": "integer"
        }
    }
